I have a total of 460 loads as follows:
20 ct box 357 Hydra Shok; 27 Rem 38+p 125 Semi JHP; 47 357 PMC 158 JSP;the rest are  reloads as follows - 50-158 jhp with 16gr. of 2400;
rest not marked- 357's  116-158swc; 50 jhp; 50 swc; 100 38wc light target loads.  Not loaded by me but my old shooting partner that loaded good ammo for 40 years but as in all reloads use for componets or at your own risk. Some in plastic cases others in factory boxes.  To clarify first 3 are factory rest are reloads.
